生成器(generator)
yield表达式

遇到yield表达式，就暂停执行后面的操作，并将紧跟在yield后面的那个表达式，作为返回对象的值

下一次调用next方法，再继续往下执行，直到遇到下一个yield表达式。

如果没有遇到新的yield表达式就一直运行到函数结束，直到return语句为止，并将return语句后面的表达式，作为返回对象的value属性值

如果该函数没有return语句，则返回的对象的value属性值为undefined



